import React, {Component} from 'react';
import {withRouter} from 'react-router-dom';

import DocInfo from '../../components/doc/doc-info/doc-info.component';

class DocPage extends Component {
    constructor(props) {
        super(props);
        this.state = {
            'content': ''
        }
    }

    componentDidMount() {
        console.log(this.props);
        this.setState({content: JSON.parse(localStorage.getItem('curDocInfo'))});
    }

    render() {
        return (
            <div
                style={{
                backgroundImage: "url(" + require("../../assets/img/covid19.jpg") + ")"
            }}
                className="page-header page-header-xs"
                data-parallax={true}>
                <div className="filter"/>
                <div className="motto text-center">
                    <h1 >
                        {this.state.content.title}
                    </h1>
                </div>
            </div>
        );
    }

}

export default withRouter(DocPage);
